import web from "../src/Images/portfolio0.jpg";
import app from "./Images/portfolio1.jpg";
import andriod from "../src/Images/portfolio02.png";
import digital from "../src/Images/portfolio3.jpg";
import ai from "../src/Images/portfolio03.png";
import software from "../src/Images/portfolio04.png";

const Sdata = [
    {
        imgsrc: web,
        title: "Web Development",
    },
    {
        imgsrc: andriod,
        title: "Android Development",
    },
    {
        imgsrc: digital,
        title: "Digital Development",
    },
    {
        imgsrc: ai,
        title: "Artificial Intelligence",
    },
    {
        imgsrc: software,
        title: "Software Development",
    },
    {
        imgsrc: app,
        title: "App Development",
    },
]

export default Sdata;
